  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Aleutian Islands
  NWR and Izembek Bay Area outlines Refuge accomplishments from September through
  December of 1955. The report begins by summarizing the weather conditions and water
  conditions during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, and fish- is also covered. The Refuge development
  and maintenance section discusses physical developments and wildfires. The public
  relations section of the report describes Refuge visitors.\",\n\t\"owner_org\":
